import React from 'react'

export default ({ projects }) => {
  return (
      projects && projects.map((text, index) =>
      <div class='some-page-wrapper'>
        <div class='row'>
          <div class='column'>
            <div class='blue-column'>
              {text}
            </div>
          </div>
          <div class='column'>
            <div class='green-column'>
              {text}
            </div>
          </div>
        </div>
      </div>
      )
  )
}
